def find_nth_prime(n):
    count = 1
    num = 2
    while count < n:
        is_prime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            count += 1
        num += 1
    return num - 1

